import { Button } from 'antd';

class Formulario extends Component {

	agregarTarea = (e) => {
		e.preventDefault();
	}


    render() {
        return (


            <Button onClick={this.agregarTarea}>Botonaso</Button>

        );
    }
}

export default Formulario;
